import React from 'react'
import Contactusimg from './images/banner7imgd.png'
import './contactus.css';
import "@fortawesome/free-solid-svg-icons"
import { faCow } from '@fortawesome/free-solid-svg-icons';


function contactus() {
  return (
    <div id='co'>
      <div className='contactusimg'>
        <img src={ Contactusimg} className='imgcontact' alt=''></img>
      </div>
        
      <h3 style={faCow}>Facebook</h3>
      <h3 style={faCow}>Whatsapp</h3>
      <h3 style={faCow}>Instagram</h3>
      <h3 style={faCow}>TWitter</h3>
    </div>
    
  )
}

export default contactus
